import React from "react";

const SaveList = ({
  saverValue,
  setsaverValue,
  saveUpShit,
  checkAll,
  uncheckAll,
  clearAll,
}) => {
  return (
    <div>
      <div>
        <input
          type="text"
          value={saverValue}
          onChange={(e) => setsaverValue(e.target.value)}
        />
        <button onClick={saveUpShit}>Save</button>
      </div>
      <div>
        <button onClick={checkAll}>Check all</button>
        <button onClick={uncheckAll}>Uncheck all</button>
        <button onClick={clearAll}>Clear List</button>
      </div>
    </div>
  );
};

export default SaveList;
